import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from 'react-router-dom';

// const root = ReactDOM.createRoot(document.getElementById('root'));

ReactDOM.render(
  <React.StrictMode>
      <App /> 
  </React.StrictMode>, document.getElementById("root")
);

function Root() {
  return (
  <BrowserRouter>
    <App />
  </BrowserRouter>
  );
}
